  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0111870 includes chemical,
  discrete sample, physical and profile data collected from L'ATALANTE in the Coral
  Sea, North Pacific Ocean and South Pacific Ocean from 1994-09-23 to 1994-10-29 and
  retrieved during cruise PACIFICA_35A319940923. These data include ALKALINITY, AMMONIUM,
  DISSOLVED INORGANIC CARBON, DISSOLVED ORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC
  PRESSURE, NITRATE, NITRATE + NITRITE CONTENT (CONCENTRATION), NITRITE, PHOSPHATE,
  SALINITY, SILICATE and WATER TEMPERATURE. The instruments used to collect these
  data include CTD, Coulometer for DIC measurement and bottle. These data were collected
  by M. Rodier of Commonwealth Scientific and Industrial Research Organization and
  R. Le Borgne [affiliation unknown] as part of the PACIFICA_35A319940923 data set.nnPACIFICA
  (PACIFic ocean Interior CArbon) was an international collaborative project for the
  data synthesis of ocean interior carbon and its related parameters in the Pacific
  Ocean. The North Pacific Marine Science Organization (PICES), Section of Carbon
  and Climate (S-CC) supported the project.\",\n\t\"license_title\": null,\n\t\"extras\":
